import React,{Component} from 'react-dom';

class Story2 extends Component{
    render(){
        return(
            <div>
            <h4> Bottle replied</h4>
            <p>Though I don't fly but I can make morons fly high in the sky</p>
            </div>
        )
    };
}

export default Story2
